import '../App.css';
import logo from '../logo.jpg';
function Navbar() {
    return (
        <div>
 
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
        <ul className="navbar-nav">
            <li className="nav-item"><a> <img src={ logo} alt="Logo" className='logo' style={{ height: '70px' }} />
</a>
      </li>
          <li className="nav-item"><a className="nav-link text-white" href="/">HOME       </a></li>
          <li className="nav-item"><a className="nav-link text-white" href="/Dashboard">Dashboard    </a></li>
          <li className="nav-item"><a className="nav-link text-white" href="/BookAppointment">Book Appointment</a></li>
          <li className="nav-item"><a className="nav-link text-white" href="/MyAppointment">My Appointment</a></li>
          <li className="nav-item"><a className="nav-link text-white" href="/Profile">profile</a></li>
          
           
        </ul>
      </div>
    
         </div>
    );  

}
export default Navbar;
